--132

create table crime_loc
(crime_type     varchar2(100),
 crime_loc      varchar2(100),
 crime_cnt      number(10));

alter table crime_loc
rename column crime_loc to c_loc;


desc crime_loc;


select * from crime_loc;



commit;


select *
    from (
        select c_loc, cnt, rank() over (order by cnt desc) rnk
            from crime_loc
            where crime_type = '살인')
    where rnk = 1;
    
--133

create table crime_cause
(
범죄유형  varchar2(30),
생계형  number(10),
유흥 number(10),
도박 number(10),
허영심 number(10),
복수  number(10),
해고  number(10),
징벌 number(10),
가정불화  number(10),
호기심 number(10),
유혹  number(10),
사고   number(10),
불만   number(10),
부주의   number(10),
기타   number(10)  );
*/


commit;

create table crime_cause2
as
select *
    from crime_cause
    unpivot (cnt for term in (생계형, 유흥, 도박, 허영심, 복수, 해고, 징벌, 가정불화, 호기심, 유혹, 사고, 불만, 부주의, 기타));
    
desc crime_cause2;

select 범죄유형
    from crime_cause2
    where cnt = (select max(cnt)
                    from crime_cause2
                    where term = '가정불화')
        and term = '가정불화';
        
